const Bellota300 = `@font-face { font-family: 'Bellota'; font-style: normal; font-weight: 300; src: local('Bellota Light'), local('Bellota-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Bellota300italic = `@font-face { font-family: 'Bellota'; font-style: italic; font-weight: 300; src: local('Bellota Light Italic'), local('Bellota-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaRegular = `@font-face { font-family: 'Bellota'; font-style: normal; font-weight: 400; src: local('Bellota Regular'), local('Bellota-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const BellotaItalic = `@font-face { font-family: 'Bellota'; font-style: italic; font-weight: 400; src: local('Bellota Italic'), local('Bellota-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Bellota700italic = `@font-face { font-family: 'Bellota'; font-style: italic; font-weight: 700; src: local('Bellota Bold Italic'), local('Bellota-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Bellota700 = `@font-face { font-family: 'Bellota'; font-style: normal; font-weight: 700; src: local('Bellota Bold'), local('Bellota-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
